<template>
  <div class="page">
    <!--先把断网的图片加载出来,等到下面进入v-else条件的时候就可以直接用上-->
    <NetBroken v-show="false"></NetBroken>
    <div v-if="netErrShow">
      <ToolBarHome :isShowNav="true">专属服务
        <div class="editCss" @click="editFun(editTxt)">{{editTxt}}</div>
      </ToolBarHome>
      <form @submit.prevent="getValue" style="margin-top: 0.3rem">
        <div class="section">
          安田惠通将免费为烟草商户提供短信订烟提醒服务

        </div>
        <div class="sectionTitle">设置订烟提醒短信</div>
        <div class='inputContainer'>
          <div class="bgc">
            <div v-show="clockShow">
              <div class="commonFlex">
                <img src="/static/assets/clock.png" class="clockCss"/>
                <div class="txtOff">{{subForm.clockVal}}</div>
                <vSwitch class="vSwicthCss" @changeSwitch="changeSwitch" :style="isSwitch" v-bind:value="switchOnOff"
                ></vSwitch>
              </div>
            </div>
            <div v-show="!clockShow">
              <div class="commonFlex">
                <img src="/static/assets/clock.png" class="clockCss"/>
                <div class="pick">
                  <PickerAmend @getClock="getClock"></PickerAmend>
                </div>
              </div>
            </div>
          </div>
        </div>
        <div class='commonFlex'>
          <div class='common_margin_left common_font commonFlex'>接收短信号码：
            <div class="expandCss">
              <input v-model="subForm.vPhone" class='expand' type='number' min="0" inputmode="numeric"
                     :readonly="isReadOnly"/>
              <img class='clearCss' v-show="subForm.vPhone" @click="clearDatas(1)"
                   src="/static/assets/clearInput.png" v-if="!isReadOnly"/>
            </div>
          </div>
        </div>
      </form>
    </div>
    <div v-else>
      <NetBroken></NetBroken>
    </div>
  </div>

</template>
<script>
  import Checkbox from '../Checkbox';
  import Divider from '../Divider.vue';
  import vSwitch from '../vSwitch.vue';
  import PickerAmend from '../PickerAmend.vue';
  import ToolBarHome from '../ToolBarHome.vue';
  import NetBroken from '../error/NetBroken.vue'//引入网络中断提示图片
  export default{
    components: {Checkbox, Divider, vSwitch, PickerAmend, ToolBarHome, NetBroken},
    data(){
      return {
        switchOnOff: false,//开关默认为关
        netErrShow: true,//断网页面显示与否
        isSwitch: "",//开关按钮能否使用
        isReadOnly: true,
        editTxt: "编辑",
        clockShow: true,//点击编辑
        flag: false,
        haveValue: '一键获取银行精准授信',
        subForm: {
          vPhone: "",//接受短信号码
          clockVal: "",//获取订制的时间
          acceptPhone: "",//查询订单短信的时候返回的手机号
        },
        dataShow: "",//判断是否已经新商盟授权
        limitShow: true,//授信额度显示
      }
    },
    methods: {

      //监听网络状态,断网
      checkNetWork(){
        let that = this;
        let el = document.body;
        if (el.addEventListener) {
//          addEventListener——兼容：firefox、chrome、IE、safari、opera；不兼容IE7、IE8
          window.addEventListener("online", function () {
            console.log("有网....");
            that.netErrShow = true;

          });
          window.addEventListener("offline", function () {
            console.error("网络走丢了....");
            that.netErrShow = false;
          });
        }
      },
      getClockTime(){
        //查询后台是否有已设置好的时间
        let that = this;
        //开始网络请求
 //       const url = that.$Constants.queryTime;
//      const url = that.$EASYMOCK.queryTime;//提交订烟提醒时间接口
        this.$api.post(this.$Constants.queryTime,
          {
            "appId": window.appId,
            "reqId": this.$StringUtils.getReqId(),
            "timestamp": Date.now(),
            "openId": this.$StringUtils.getOpenId(),
            "data": {
              "phone": sessionStorage.getItem("inputPhone")
            }
          }, function (result) {
            this.$indicator.close()
            let that = this;
            console.log(JSON.stringify(result));
            if (result && result.data) {
              if (!that.$StringUtils.isEmpty(result.data.acceptPhone)) {
                that.subForm.vPhone = result.data.acceptPhone;
                that.subForm.acceptPhone = result.data.acceptPhone;
              }
              if (!that.$StringUtils.isEmpty(result.data.crtTime) && !that.$StringUtils.isEmpty(result.data.week)) {
                that.subForm.clockVal = result.data.week +" "+ result.data.crtTime;
              }
              if (!that.$StringUtils.isEmpty(result.data.state) ) {
                if('0'==result.data.state){
                  that.switchOnOff=false;//开关默认为关
                }else{
                  that.switchOnOff=true;
                }
              }
            }
          }.bind(this), function (err) {
            this.$indicator.close()
          }.bind(this))
      },
      changeSwitch(val){

        //打开开关，把设置好的时间送到后台接口
        let that = this;
        //表单校验
        if (!that.validata.checkForm(that.subForm)) {
          that.$VALID.dialog(that.validata.errorList[0]);
          return
        }
        let statusOnOff="";
        if(val){
          statusOnOff='1';//开关为开
        }else {
          statusOnOff='0';
        }
        //缓存信息
        that.$CACHE.putCache("cacheVClockphone", that.subForm.vPhone);
        that.$CACHE.putCache("cacheClockVal", that.subForm.clockVal);

        //开始网络请求
//        const url = that.$Constants.updateTime;
//        const url = that.$EASYMOCK.dingTime;//提交订烟提醒时间接口
        this.$api.post(this.$Constants.updateTime, {
          "appId": window.appId,
          "reqId": this.$StringUtils.getReqId(),
          "timestamp": Date.now(),
          "openId": this.$StringUtils.getOpenId(),
          "data": {
            "phone": sessionStorage.getItem("inputPhone"),
            "acceptPhone": that.subForm.vPhone,
            "week": that.subForm.week,
            "crtTime": that.subForm.crtTime,//时间数
            "state": statusOnOff //打开开关
          }
        },function (result) {
          indicator.close()
          if (result && result.ret == 0) {
            if(val){
              that.$utils.toast("设置成功");
            }else {
              that.$utils.toast("关闭成功");
            }
          }
        }.bind(this), function (err) {
          console.warn('返回码有误！');
        }.bind(this))
      },
      getClock(val){
        //Picker.vue组件获取订制时间
        this.subForm.clockVal = val;
        if (val.indexOf(" ")) {
          //截取picker.vue组件选中的时间
          let strArr = val.split(" ");
          //分割星期和时间,赋值发送给后台的值
          this.subForm.week = strArr[0];
          this.subForm.crtTime = strArr[1];
        }
      },
      editFun(val){
        //点击编辑
        let that = this;
        console.error(val);
        that.switchOnOff = false;
        that.clockShow = !that.clockShow;
        that.editTxt = that.clockShow == true ? "编辑" : "保存";
        that.isReadOnly = that.clockShow == true ? true : false;//接收短信手机号的可编辑与否
        if ('保存' == val) {
          if (!that.validata.checkForm(that.subForm)) {
            console.error("5555");
            that.$VALID.dialog(that.validata.errorList[0]);
            that.isSwitch = "pointer-events:none";
            return
          }
          that.isSwitch = "";
        }
      },

      //缓存回显
      cacheShow(){
        let that = this;

        that.subForm.vPhone = sessionStorage.getItem("inputPhone");
        //接受短信号码
        let cacheVClockphone = that.$CACHE.getCache("cacheVClockphone");
        if (!that.$StringUtils.isEmpty(cacheVClockphone)) {
          that.subForm.vPhone = cacheVClockphone;
        }
        //订烟时间
        let cacheClockVal = that.$CACHE.getCache("cacheClockVal");
        if (!that.$StringUtils.isEmpty(cacheClockVal)) {
          that.subForm.clockVal = cacheClockVal;
        }

      },
      //清除输入框数据
      clearDatas(num) {
        if (num === 1) {
          this.subForm.vPhone = '';
        }
      },
      //测试用
      toTest(){
        console.info("点击一张就出现一张并排的：");
      },
      toProcol(){
        this.$router.push(this.$RM.Protocol);
      },
      toastMsg(){

        var that = this;
        //临时 授权信息通知的弹出框
        let tempTan = localStorage.getItem("Two");
        if (that.$StringUtils.isEmpty(tempTan)) {
          tempTan = 'yes';
        }
        if (tempTan == 'yes') {
          that.$dialog.confirm('您在安田惠通上申请的银行授信无需向第三方机构、个人以及安田服务人员支付任何中介服务费，如有收取请及时与我司联系！', '温馨提示', {
            showCancelButton: false,
            confirmButtonText: "确定",
          })
            .then(() => {
              console.log("停留在当前页面");
              localStorage.setItem("Two", "no");
            })
            .catch(() => {
              console.log("停留在当前页面");
              localStorage.setItem("Two", "no");
            });
        }
      },
      validForm(){
        let that = this;
        //初始化表单校验的值
        that.validata = new that.$VALID.proveUtil({
          vPhone: that.$VALID.rules.phoneRule, //接受短信号码
          clockVal: that.$VALID.rules.clockVal, //获取订制的时间
        }, {
          vPhone: that.$VALID.messages.phoneRule, //规则出错时的提示信息
          clockVal: that.$VALID.messages.clockVal,
        });

      },

    },
    created(){
      this.checkNetWork();
    },
    mounted()
    {
      let that = this;

      that.toastMsg();//温馨提示
//      this.subForm.clockVal="测试66666";
//      that.subForm.vPhone = "13647798517";
//      that.subForm.clockVal = "每周日 8:00";
      that.validForm();//初始化表单校验的值
       that.cacheShow();//缓存回显
      that.getClockTime();

    },
    watch: {
      //监听这两个值的改变，一改变样式也相对改变
      'subForm.vPhone': {
        handler(val){
          if (val.length > this.$CONST.CData.phoneLen) {
            this.subForm.vPhone = String(val).slice(0, this.$CONST.CData.phoneLen);
          }
        }
      },
      'subForm.clockVal': {
        handler(){
        }
      },
    },
  }
</script>
